const ArchiveLocations= ({cityList, lang}) => {

    return (
      <div className="archive__locations">
        {
          cityList.map((city) => (
            <button className="archive__locations__city">{city}</button>
          ))
        }
      </div>
    )
  }

  export default ArchiveLocations
